import './App.css';
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import {
  BrowserRouter as Router,
   Route,
 } from "react-router-dom";
import Dashboard from './components/dashboard';

function App() {
  return (
    <div className="App">
              <Switch>

      <Router>
        <Route path="/app">
          <Dashboard />
        </Route>
      </Router>
      </Switch>

    </div >
  );
}

export default App;
